import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

function VoertuigPage() {
  const [vehicles, setVehicles] = useState([]);
  const [newVehicle, setNewVehicle] = useState({
    model: '',
    brand: '',
    chassisNumber: '',
    licensePlate: '',
    fuelType: '',
    vehicleType: '',
    color: '',
    seats: '',
    doors: '',
  });
  const [error, setError] = useState(null);
  const [showForm, setShowForm] = useState(false);

  // Ophalen van voertuigen
  useEffect(() => {
    axios.get('/api/voertuigen')
      .then(response => setVehicles(response.data))
      .catch(error => setError("Er is een fout opgetreden bij het ophalen van voertuigen."));
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewVehicle({
      ...newVehicle,
      [name]: value
    });
  };

  const handleAddVehicle = (e) => {
    e.preventDefault();
    axios.post('/api/voertuigen', newVehicle)
      .then(response => {
        setVehicles([...vehicles, response.data]);
        setNewVehicle({
          model: '',
          brand: '',
          chassisNumber: '',
          licensePlate: '',
          fuelType: '',
          vehicleType: '',
          color: '',
          seats: '',
          doors: '',
        });
        setShowForm(false);
      })
      .catch(error => setError("Er is een fout opgetreden bij het toevoegen van het voertuig."));
  };

  const handleDeleteVehicle = (chassisNumber) => {
    axios.delete(`/api/voertuigen/${chassisNumber}`)
      .then(() => {
        setVehicles(vehicles.filter(vehicle => vehicle.chassisNumber !== chassisNumber));
      })
      .catch(error => setError("Er is een fout opgetreden bij het verwijderen van het voertuig."));
  };

  return (
    <div className="container mt-5">
      <h1 className="text-center mb-4">Voertuig Pagina</h1>
      {error && <div className="alert alert-danger">{error}</div>}

      <div className="d-flex justify-content-between mb-3">
        <button className="btn btn-primary" onClick={() => setShowForm(true)}>
          Nieuw Voertuig Toevoegen
        </button>
      </div>

      {showForm && (
        <form onSubmit={handleAddVehicle} className="card p-4">
          <h2>Voertuig Toevoegen</h2>
          <div className="form-group">
            <label>Model:</label>
            <input
              type="text"
              name="model"
              value={newVehicle.model}
              onChange={handleInputChange}
              className="form-control"
              required
            />
          </div>
          <div className="form-group">
            <label>Merk:</label>
            <input
              type="text"
              name="brand"
              value={newVehicle.brand}
              onChange={handleInputChange}
              className="form-control"
              required
            />
          </div>
          <div className="form-group">
            <label>Chassisnummer:</label>
            <input
              type="text"
              name="chassisNumber"
              value={newVehicle.chassisNumber}
              onChange={handleInputChange}
              className="form-control"
              required
            />
          </div>
          <div className="form-group">
            <label>Kenteken:</label>
            <input
              type="text"
              name="licensePlate"
              value={newVehicle.licensePlate}
              onChange={handleInputChange}
              className="form-control"
              required
            />
          </div>
          <div className="form-group">
            <label>Brandstoftype:</label>
            <input
              type="text"
              name="fuelType"
              value={newVehicle.fuelType}
              onChange={handleInputChange}
              className="form-control"
              required
            />
          </div>
          <div className="form-group">
            <label>Voertuigtype:</label>
            <input
              type="text"
              name="vehicleType"
              value={newVehicle.vehicleType}
              onChange={handleInputChange}
              className="form-control"
              required
            />
          </div>
          <div className="form-group">
            <label>Kleur:</label>
            <input
              type="text"
              name="color"
              value={newVehicle.color}
              onChange={handleInputChange}
              className="form-control"
              required
            />
          </div>
          <div className="form-group">
            <label>Aantal stoelen:</label>
            <input
              type="number"
              name="seats"
              value={newVehicle.seats}
              onChange={handleInputChange}
              className="form-control"
              required
            />
          </div>
          <div className="form-group">
            <label>Aantal deuren:</label>
            <input
              type="number"
              name="doors"
              value={newVehicle.doors}
              onChange={handleInputChange}
              className="form-control"
              required
            />
          </div>
          <button type="submit" className="btn btn-success">Voertuig Toevoegen</button>
          <button type="button" onClick={() => setShowForm(false)} className="btn btn-danger ml-2">Annuleren</button>
        </form>
      )}

      <div className="vehicle-list mt-4">
        {vehicles.map(vehicle => (
          <div key={vehicle.chassisNumber} className="card mb-3 p-3">
            <h3>{vehicle.model}</h3>
            <p><strong>Merk:</strong> {vehicle.brand}</p>
            <p><strong>Kenteken:</strong> {vehicle.licensePlate}</p>
            <button onClick={() => handleDeleteVehicle(vehicle.chassisNumber)} className="btn btn-danger">Verwijderen</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default VoertuigPage;
